{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/violetmakena/bike-share-divvy-analysis?scriptVersionId=107288435\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"395409d6","metadata":{"papermill":{"duration":0.007442,"end_time":"2022-10-05T19:31:46.881325","exception":false,"start_time":"2022-10-05T19:31:46.873883","status":"completed"},"tags":[]},"source":["# Bikeshare Case Study\n","\n","***Introduction***\n","\n","Cyclistic's bike-share program debuted in 2016. Since then, 5,824 geotracked bikes have been added to 692 stations around Chicago. Unlocked bikes may be returned to any system station.\\nCyclistic's marketing approach formerly focused on wide consumer appeal. Single-ride passes, full-day tickets, and yearly memberships helped make this possible. Casual cyclists buy single-ride or full-day passes. Cyclistic members buy yearly memberships.\n","\n","Annual members are more lucrative than casual cyclists, say Cyclistic's experts. Moreno thinks raising the number of yearly members will be crucial to future success. Moreno thinks he can turn casual riders into members without targeting new consumers. She says casual bikers know about Cyclistic and use it for mobility.\n","\n","Moreno is focused. Convert casual riders into yearly members via marketing. The marketing analyst team must understand how yearly members and casual riders vary, why casual riders would acquire a membership, and how digital media may alter their marketing methods. Moreno and her colleagues want to analyze Cyclistic bike ride data for patterns.\n","\n","***Objectives***\n","\n","The objective is  to comprehend how casual riders and yearly members use Cyclistic bikes differently. Your team will build a new marketing plan based on these findings to convert casual riders into members."]},{"cell_type":"markdown","id":"42328406","metadata":{"papermill":{"duration":0.005872,"end_time":"2022-10-05T19:31:46.893447","exception":false,"start_time":"2022-10-05T19:31:46.887575","status":"completed"},"tags":[]},"source":["# ASK\n","The project seeks to examine the data acquired in order to get insights from the number of trips taken, ride length, and the activity of various user types. We are to offer recommendations for developing a company plan based on the findings.\n","\n","\n","# PREPARE\n","\n","**Data**\n","\n","The data has been made available by Motivate International Inc.Under this [license](http://www.divvybikes.com/data-license-agreement). The following are the available variables\n","ride_id: \n","unique id of a single trip (string)\n","rideable_type: type of bike used (string)\n","started_at: date and time the bike was undocked (datetime)\n","ended_at: date and time the bike was docked (datetime)\n","start_station_name: location of start docking station (string)\n","start_station_id: id of start docking station (string)\n","end_station_name: location of end docking station (string)\n","end_station_id: id of end docking station (string)\n","start_lat: start docking station latitude (numeric)\n","start_lng: start docking station longitude (numeric)\n","end_lat: end docking station latitude (numeric)\n","end_lng: end docking station longitude (numeric)\n","member_casual: rider type (string)\n","The data is available [here](http://divvy-tripdata.s3.amazonaws.com/index.html)\n","\n","# PROCESS\n","\n","will be used since it can manage huge volumes of data. In addition, data may be easily cleaned and presented, which facilitates analysis. The data were obtained in zip file and then transformed to csv before being uploaded to R. The documents were filed for further examination.\\nThe data is given in a tabular manner with consistent column names. In addition, numerous column names were altered since they were ambiguous. For the tenth and eleventh months of 2020, the data type in the start station id and finish station id columns is inconsistent; the data appears as an integer but is really a character. Consequently, the data type is updated to address the problem. Additionally, the data type of the began at and concluded at columns is inconsistent; rather than date time, the data type seems to be character. The data are thus transformed to date-time format. The usage of R Markdown for documentation and reporting.\n"]},{"cell_type":"markdown","id":"82295e06","metadata":{"papermill":{"duration":0.005881,"end_time":"2022-10-05T19:31:46.905267","exception":false,"start_time":"2022-10-05T19:31:46.899386","status":"completed"},"tags":[]},"source":["# Analysis\n","## STEP ONE \n","\n","**Install packages**"]},{"cell_type":"code","execution_count":1,"id":"d8076d54","metadata":{"execution":{"iopub.execute_input":"2022-10-05T19:31:46.920514Z","iopub.status.busy":"2022-10-05T19:31:46.918853Z","iopub.status.idle":"2022-10-05T19:32:54.9288Z","shell.execute_reply":"2022-10-05T19:32:54.927251Z"},"papermill":{"duration":68.019427,"end_time":"2022-10-05T19:32:54.930722","exception":false,"start_time":"2022-10-05T19:31:46.911295","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u00