 \"classic bikes,\" whereas docked bikes are the most common among casuals. The least common bikes is the electric bike.  \n","* From June through September, there is a substantial rise in the total number of rides for both groups. July is when the most rides are taken by casual riders, whereas the most rides taken by members occur in August and September. It's possible that the warm weather is to blame for this. \n","* The number of rides for both categories is at its lowest during the months of December, January, and February. It's possible that the chilly weather is to blame for this."]},{"cell_type":"markdown","id":"cb438bd5","metadata":{"papermill":{"duration":0.022286,"end_time":"2022-10-05T19:34:52.506916","exception":false,"start_time":"2022-10-05T19:34:52.48463","status":"completed"},"tags":[]},"source":["## Recommendations\n","\n","*  The organization would provide seasonal memberships as a means of luring purchases from infrequent customers during busy seasons.  \n","*  Because of the differences in their preferences, the marketing team has to develop a strategy that can appeal to both types of customers. \n","*  The marketing team should prioritize the development of many campaigns centered on relevant topics throughout the months of August and September. Develop engaging sales strategies for the months that bring in the most revenue."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":190.091344,"end_time":"2022-10-05T19:34:52.950359","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-10-05T19:31:42.859015","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}